‚ÄúThis picture has been taken in St. Ives, Cornwall in May'20, literally in the first days when lockdown loosened in the UK and people could start travel between cities. My friend and I decided to go on a trip through Cornwall. It was the best time to do it as was empty and quiet everywhere. St. Ives was our last stop. It was a very productive and amazing day. I almost finished my last roll at the port when suddenly lovely old couple parked this beautiful FORD Escord and went for a walk. I had only two shots left and this photo is one of them.
Film has changed my photography life completely as I came from the digital world. It‚Äôs like meditation for me as you need to be really present while shooting. You‚Äôre training your focus and sharpening the senses because every single shot has a value. I literally love the whole process. There is also something special behind the final look which is really important for me. Definitely not seeing my self coming back to digital.
I'm based in Bristol, UK  at the moment but I love to travel everywhere especially to big cities. Urban industrial environment is my favourite to shoot.
I don't listen to music while shooting but probably some old school track from 70s would suit best this photo. Maybe Aerosmith- Dream on?
I used Mamiya RB6x7 with 6x8 motor back and roll of expired Portra 160NC 220 film.‚Äù

